public class ImageSaver : MonoBehaviour {} We can then create a function called SaveImageToLocalDisk that takes in the texture and the filename of the image to save. To save a texture as a PNG, we have to encode it to PNG using EncodeToPNG() and store it within a byte array. We can then use File.WriteAllBytes() to save the image to the persistentDataPath. public void SaveImageToLocalDisk(Texture2D texture, string fileName)
{ if (texture == null) { Debug.Log("Nothing to save to local disk"); return; } byte[] textureBytes = texture.EncodeToPNG(); File.WriteAllBytes(Application.persistentDataPath + "_" + fileName, textureBytes); Debug.Log("Saved to local disk!");
} To check on the texutre, you can go to c:/> users > yourUserHere > AppData > LocalLow > DefaultCompany. If you do not see AppData, make sure File Explorer is showing hidden filesby enabling the setting under ... > Options > View > Hidden files and folders > Show hidden files, folders, and drives > Apply. To Load the texture, we can create a function called GetTextureFromLocalDisk(). The process is basically the same as saving it. But this time, I added a failsave where if the file doesn't exit in the persistentDataPath, I will instead load a texture stored in the Resources folder using Resources.Load(). public Texture2D GetTextureFromLocalDisk(string fileName)
{ byte[] textureBytes; Texture2D loadTexture; if (!File.Exists(Application.persistentDataPath + "_" + fileName)) { loadTexture = Resources.Load<Texture2D>("FYP_Q3_AI_" + fileName); loadTexture.filterMode = FilterMode.Point; return loadTexture; } textureBytes = File.ReadAllBytes(Application.persistentDataPath + "_" + fileName); loadTexture = new Texture2D(0, 0); loadTexture.LoadImage(textureBytes); loadTexture.filterMode = FilterMode.Point; return loadTexture;
}

